	(77, 0, 77, 'ব্যথা নিরোধক ( NSAIDS) ওষুধ, ACEi (Losartan,olmesarton etc), Codine, ঘুমের ওষুধ, মাদকদ্রব্য,  উদ্বেগ; দুশ্চিন্তা; উৎকণ্ঠার জন্য ব্যবহৃত ঔষধ (Anxiolytics)  চিকিত্সকের পরামর্শ ছাড়া ব্যবহার সম্পূর্ণরূপে নিষিদ্ধ ।', 727, 2, '2020-03-18 18:32:05', '1001'),
	(78, 0, 78, 'প্রতিদিন আপনার পায়ের পরীক্ষা করুন। কাটা, ফোস্কা, লালভাব, ফোলাভাব বা নখের সমস্যাগুলি পরীক্ষা করে দেখুন। আপনার পায়ের নীচের অংশটি দেখার জন্য ম্যাগনিফাইং হ্যান্ড মিরর ব্যবহার করতে পারেন ।', 1016, 2, '2020-04-01 15:43:09', '1001'),
