	(80, 0, 80, 'পা ধোয়ার  সময় কোমল হোন। নরম ওয়াশক্লোথ বা স্পঞ্জ ব্যবহার করুন ।', 1016, 2, '2020-04-01 15:44:40', '1001'),
	(81, 0, 81, 'আপনার পায়ের আর্দ্রতা বজায় রাখুন;  শুষ্ক ত্বক , চুলকানি বা ক্র্যাকিং থেকে রক্ষা পেতে প্রতিদিন ময়েশ্চারাইজার ব্যবহার করুন। তবে পায়ের আঙ্গুলের মাঝখানে   মাশ্চারাইজ করবেন না - এটি ছত্রাকের সংক্রমণকে উত্সাহিত করতে পারে।', 1016, 2, '2020-04-01 15:45:10', '1001'),
	(82, 0, 82, 'সাবধানে নখ কাটুন। খুব ছোট করে নখ কাটবেন না, কারণ এটি পায়ের নখের গোড়ায় প্রবেশ করতে পারে।', 1016, 2, '2020-04-01 15:45:44', '1001'),
	(83, 0, 83, 'কখনও কর্নস বা কেলাস এর চিকিত্সা নিজে করবেন না। উপযুক্ত চিকিত্সার জন্য আপনার ডাক্তারের সাথে যান।', 1016, 2, '2020-04-01 15:46:16', '1001'),
	(84, 0, 84, 'পরিষ্কার, শুকনো মোজা পরুন এবং প্রতিদিন পরিবর্তন করুন। ডায়াবেটিসে আক্রান্ত রোগীদের জন্য বিশেষভাবে  তৈরি মোজা বিবেচনা করুন। এই মোজাগুলির অতিরিক্ত কুশনিং রয়েছে, ইলাস্টিক শীর্ষগুলি নেই, গোড়ালির উপরের অংশ পর্যন্ত ঢেকে রাখে', 1016, 2, '2020-04-01 15:47:21', '1001'),
	(85, 0, 85, 'রাতে যদি আপনার পা ঠান্ডা হয় তবে মোজা পরে ঘুমান। কোন হিটিং প্যাড বা গরম জলের বোতল কখনও ব্যবহার করবেন না।', 1016, 2, '2020-04-01 15:47:53', '1001'),
