	(87, 0, 87, 'আপনার পা উষ্ণ এবং শুকনো রাখুন। বরফ বা বৃষ্টিতে আপনার পা ভেজাতে দেবেন না। শীতে গরম মোজা এবং জুতো পরুন।', 1016, 2, '2020-04-01 15:49:10', '1001'),
