	(124, 0, 124, 'পাস্তা, নুডলস এবং শর্করাযুক্ত  শাকসব্জী (উদাঃ আলু, গাজর, কর্ন এবং ইয়াম) -ইত্যাদি খাবেন না ।', 60, 2, '2020-11-25 13:42:15', '1001'),
	(125, 0, 125, 'আপনার রক্তে গ্লুকোজের দ্রুত বৃদ্ধি রোধ করতে ফাইবার সমৃদ্ধ খাবার যেমন ব্রাউন রাইস এবং  whole grain এর রুটি খান।', 60, 2, '2020-11-25 13:42:46', '1001'),
	(126, 0, 126, 'সবুজ শাকসবজি অত্যন্ত পুষ্টিকর এবং ক্যালোরি কম থাকে।এগুলিতে হজমযোগ্য কার্বস বা শরীরে শোষিত কার্বসগুলিও খুব কম, সুতরাং তারা রক্তে শর্করার মাত্রাকে উল্লেখযোগ্যভাবে বাড়াবে না। ভিটামিন সি একটি শক্তিশালী অ্যান্টিঅক্সিডেন্ট হিসাবে কাজ করে এবং এন্টি-ইনফ্ল্যামেটরি গুণও রয়েছে।এই সব খাবার প্রচুর পরিমাণে খাবেন ।', 60, 2, '2020-11-25 13:44:31', '1001'),
	(127, 0, 127, 'আপনাকে পর্যাপ্ত ভিটামিন, খনিজ, অ্যান্টিঅক্সিডেন্টস এবং ফাইবার সরবরাহ করতে প্রতিদিন ১-২টি ফল খাবেন ।  যেহেতু ফলের মধ্যে শর্করা আকারে কার্বোহাইড্রেট রয়েছে তাই আপনি অত্যধিক পরিমাণ খাবেন না । শুকনো ফল কম খাবেন, কারণ এগুলিতে তাজা ফলের চেয়ে চিনির পরিমাণ বেশি।', 60, 2, '2020-11-25 13:45:40', '1001'),
	(128, 0, 128, 'চর্বি জাতীয় খাবার  গ্রহণে সতর্ক হউন ।ডায়াবেটিস রোগীদের অত্যধিক পরিমাণে চর্বি বা তেল খাওয়া উচিত নয়, কারণ এটি ইনসুলিন কর্মের কার্যকারিতা হ্রাস করে। রান্না করার সময় কম তেল ব্যবহার করুন এবং খাওয়ার আগে সমস্ত দৃশ্যমান ফ্যাট অপসারণ করুন । ডিপ-ফ্রাইং খাবারের পরিবর্তে, বাষ্প, ফুটন্ত এবং গ্রিলিংয়ের মতো স্বাস্থ্যকর রান্না পদ্ধতি নির্বাচন করুন।  Skin বা চামড়া ছাড়া চর্বিহীন মাংস খাবেন ।', 60, 2, '2020-11-25 13:46:37', '1001'),
	(129, 0, 129, 'ফ্যাটবিহীন বা লো-ফ্যাটযুক্ত খাবার গুলি যেমন কম ফ্যাটযুক্ত দুধ এবং ফ্যাট-মুক্ত দই খাবেন ।', 60, 2, '2020-11-25 13:47:55', '1001'),
	(130, 0, 130, 'পলিঅনস্যাচুরেটেড ফ্যাট (Walnuts,Sunflower seeds,Flax seeds or flax oil,Fish oil,Corn oil,Soybean oil,Safflower oil) বা মনস্যাচুরেটেড ফ্যাট (উদাঃ জলপাই, ক্যানোলা) দিয়ে রান্না করুন ।', 60, 2, '2020-11-25 13:49:00', '1001'),
	(131, 0, 131, 'অ্যালকোহল নিষিদ্ধ । এতে  রক্তের ট্রাইগ্লিসারাইড বেড়ে যায় ;লিভার, কিডনি  বা হৃদরোগে আক্রান্ত হতে পারেন ।', 60, 2, '2020-11-25 13:49:34', '1001'),
	(132, 0, 132, 'মলত্যাগ করার পর মলদ্বার সামনে থেকে পিছনে পরিস্কার করুন বা  মুছূন ।  এই অভ্যাসটি মলদ্বার থেকে মূত্রনালীতে ব্যাকটেরিয়া  আনার ঝুঁকি হ্রাস করে। ডায়রিয়া হলে এটি করা আরও বেশি জরুরি।', 1253, 2, '2020-11-25 13:59:56', '1001'),
	(133, 0, 133, 'প্রচুর তরল পান করুন ।এতে  আপনার  আরও ঘন ঘন প্রস্রাব হবে  যা আপনার মূত্রনালীর বা মূত্রথলির ব্যাকটেরিয়া ফ্লাশ করে। অ্যালকোহল এবং ক্যাফিনেটেড পানীয়গুলি এড়িয়ে যাওয়ার চেষ্টা করুন, যা মূত্রাশয়কে irritate বা জ্বালাতন করতে পারে।', 1253, 2, '2020-11-25 14:00:33', '1001'),
	(134, 0, 134, 'প্রস্রাব ধরে রাখা থেকে বিরত থাকুন, কারণ এটি মূত্রাশয়ে  ব্যাকটিরিয়া বৃদ্ধির   সময় পায়।  প্রস্রাব করার জন্য ৩ থেকে ৪ ঘন্টার বেশি অপেক্ষা না করার চেষ্টা করুন এবং প্রতিবার আপনার মূত্রাশয়কে পুরোপুরি খালি করুন।', 1253, 2, '2020-11-25 14:01:37', '1001'),
	(135, 0, 135, 'সেক্স করার আগে এবং পরে অবিলম্বে প্রস্রাব করুন।  এতে  যে ব্যাকটিরিয়াগুলি দ্বারা  UTI  হতে পারে তা ফ্ল্যাশ হয়ে যায় ।', 1253, 2, '2020-11-25 14:02:04', '1001'),
	(136, 0, 136, 'সুগন্ধযুক্ত স্নানের তেল, সাবান, সুগন্ধযুক্ত প্যাড বা ট্যাম্পন ক্ষতিকারক যা মূত্রাশয় বা মূত্রথলির ব্যাকটেরিয়াগুলিকে অত্যধিক বৃদ্ধি করতে পারে ।এই সব ব্যবহার এড়িয়ে চলুন।', 1253, 2, '2020-11-25 14:02:29', '1001'),
	(137, 0, 137, 'কিছু জন্ম নিয়ন্ত্রণ পদ্দ্বতি মূত্রাশয় বা মূত্রনালির ক্ষতিকারক ব্যাকটিরিয়াগুলিকে অতিরিক্ত বৃদ্ধি   করতে পারে।  তাই যাদের বার বার UTI হচ্ছে তারা  যথা সম্বব  ডায়াফ্রামস, নন-লুব্রিকেটেড  কনডম, শুক্রাণু বিদ্ধ্বংসী  কনডম ইত্যাদি পরিহার করুন ।', 1253, 2, '2020-11-25 14:02:57', '1001'),
	(138, 0, 138, 'প্রোবায়োটিকস  হল লাইভ মাইক্রো অর্গানিজম বা ব্যাকটেরিয়া  যা  অন্ত্রর ভালো ব্যাকটিরিয়া গুলুকে  বাড়াতে পারে।  এগুলি মূত্রনালীর ভাল ব্যাকটেরিয়া বৃদ্ধিতেও সহায়তা করতে পারে যারা আপনাকে UTI এর  হাত থেকে রক্ষা করতে সহায়তা করতে পারে/ যাদের বার বার UTI হচ্ছে তারা নিদৃস্ট সময় পর পর  প্রোবায়োটিকস  খেতে পারেন ।', 1253, 2, '2020-11-25 14:03:35', '1001'),
	(139, 0, 139, 'ক্র্যানবেরি জুস খাবেন । এটি আপনার মূত্রাশয় বা মূত্রনালীতে  ব্যাকটেরিয়া প্রবেশে বাধা প্রদান করে ।', 1253, 2, '2020-11-25 14:04:02', '1001'),
	(140, 0, 140, 'ঘরের মেজেতে কার্পেট ব্যবহার করবেন না  ।  কার্পেট এর পরিবর্তে ফ্লোর বোর্ড ব্যবহার করুন ,এটি  বাড়ির ধুলিকণা ও অন্যানো এরোলারজেন থেকে আপনাকে রক্ষা করবে ।', 217, 2, '2020-11-25 14:08:43', '1001'),
	(141, 0, 141, 'প্রচলিত জায়নামাজ এ নামাজ পড়বেন না । নামাজ এর জন্যে সাদা কাপড় বা বেথের পাটি  ব্যবহার করুন।', 217, 2, '2020-11-25 14:09:14', '1001'),
	(143, 0, 143, 'শ্বাসযন্ত্রের সংক্রমণ যেমন সাধারণ সর্দি (common cold ) আপনার আপনার শ্বাসকষ্ট বাড়িয়ে দিবে ঠান্ডা বাতাস বা অতিরিক্ত গরম এড়িয়ে চলুন ।', 217, 2, '2020-11-25 14:10:02', '1001'),
	(144, 0, 144, 'বিটা ব্লকার, অ্যাসপিরিন এবং ননস্টেরয়েডাল প্রদাহবিরোধী ওষুধ, যেমন আইবুপ্রোফেন ,এসিক্লোফেনাক ,এন্ডোমেথাসিন ,ডাইক্লোফেনাক , নেপ্রোক্সেন সোডিয়াম সহ যে সব ওষুধ শাসকষ্ট বাড়ায় সেগুলো খাবেন না ।', 217, 2, '2020-11-25 14:10:30', '1001'),
	(145, 0, 145, 'অতিরিক্ত আবেগ  এবং মানসিক  চাপ শ্বাসকষ্ট বাড়াতে পারে /যথা সম্ভব এড়িয়ে চলুন ।', 217, 2, '2020-11-25 14:10:56', '1001'),
	(146, 0, 146, 'চিংড়ি, শুকনো ফল, প্রক্রিয়াজাত আলু, বিয়ার এবং ওয়াইন সহ কিছু ধরণের খাবার এবং পানীয়গুলিতে সালফাইটস এবং সংরক্ষণকারী কেমিকাল যোগ  করা হয় যা আপনার শরীরে এলার্জেন হিসেবে কাজ করে ও শ্বাসকষ্ট বাড়িয়ে দে এ । সব খাবার না খাওয়াই ভালো   ।', 217, 2, '2020-11-25 14:11:20', '1001'),
	(147, 0, 147, 'গ্যাস্ট্রোসফেজিয়াল  রিফ্লাক্স  ডিজিজ (জিইআরডি), এমন একটি রোগ যাতে শোয়া অবস্থায়  পেট থেকে  অ্যাসিড আপনার শ্বাসনালিতে  আসে এবং রাতে আপনার কাশি ও শাসকষ্ট বাড়ায় । প্রয়জনে এ রোগ এর চিকিৎসা নিন ।', 217, 2, '2020-11-25 14:11:42', '1001'),
	(149, 0, 148, 'ইউরিক অ্যাসিড নামক একটি রাসায়নিক পদার্থ  শরীরের বিভিন্ন  গিরায় বা জয়েন্টে জমে গাউট  নামক রোগটি হয় /তাই ইউরিক অ্যাসিড সম্মৃধ্য নিচের খাবার সমূহ যথা সম্ভব এড়িয়ে চলুন বা একদম খাবেন না ।', 312, 2, '2020-11-25 14:17:58', '1001'),
	(150, 0, 149, 'নিষিদ্দ খাবার সমূহ ;  চিংড়ি, গলদা চিংড়ি, কাঁকড়া, ঝিনুক, শামুক, শাক,কডমাছ, সামুদ্রের পোনামাছ ইত্যাদি সামুদ্রিক খাবার ।যকৃত(Liver); মস্তিষ্ক( Brain ); ছাগল,গরু, খাশি,হাস,হরিণ ও শূকরের মাংস ।শতমূলী, শিম; কড়ই ও মঠর শুঠি, মাশরুম, ডাল, মসুর ডাল, শাক (spinach), ফুলকপি ইত্যাদি ।', 312, 2, '2020-11-25 14:18:28', '1001'),
	(151, 0, 150, 'দৈনিক এক ঘন্টা হাঁটুন অথবা হালকা এক্সারসাইজ করুন।', 230, 2, '2020-11-25 14:21:06', '1001'),
	(152, 0, 151, 'গরু, খাসি ও অন্য মাংস জাতীয় খাবার কম খাবেন ।', 230, 2, '2020-11-25 14:21:41', '1001'),
	(153, 0, 152, 'আপনার ওষুদের তালিকায় কোষ্টকাঠিন্ন করে এ রকম কোনো ওষুধ আছে কিনা সে ব্যাপারে আপনার চিকিৎসকের পরামর্শ নিন।', 230, 2, '2020-11-25 14:22:07', '1001');
