INSERT IGNORE INTO `tbadvisehistory` (`autoId`, `patientid`, `visitNo`, `slNo`, `adviseId`, `advise`, `entryTime`, `entryBy`) VALUES
	(11, 1, 1, 0, 11, 'দুশ্চিন্তা/রাগ/উত্তেজনা পরিহার করবেন।', '2019-02-13 14:47:52', '1'),
